import {Outlet, Link} from "react-router-dom"
import '../index.css'
const NavBar = () => {
    return (
        <>
            <nav className = "navigationBar">
                <Link classNmae = "signUpLink" to = "/">Home</Link>
                <div className = "navigationBarRight">
                    <Link to = "/sign-up">Sign Up</Link>
                </div>
            </nav>

            <Outlet/>
        </>
    )
}

export default NavBar;
